import React, {Component} from "react"
import styled from 'styled-components'
import Group from './Group.png';




class Home extends Component {
  render(){
  return (


   <div>
     <br/>
    <PictureContainer className ="kimberly-pic">
      <img className ="group" src={Group} class="kimberly-pic"/>

      <span>Hello my name is Kimberly, nice to meet you :)</span>

    </PictureContainer>









    </div>
  );
  }
}

export default Home;


const PictureContainer = styled.picture`
.kimberly-pic{
  padding-top: 3rem;
  padding-bottom: 3rem;
  display: block;
  margin-left: 5%;
  margin-right: auto;
  width: 20%;

}
`
const RedText = styled.p`
  display: block;
  margin-left: 5%;
  color: red;
`
